import React, { Component } from '"react"';

class Book extends Component {
  render() {
    return (
      <div>
          <li className="list-group-item d-flex">
            <p> this.props.name </p>
            <span className="ml-auto"> this.props.price </span>
          </li>
      </div>
    );
  }
}

export default Book
